import styled from 'styled-components';

const DeleteCartItemStyles = styled.div`
  button {
    padding: 0;
    margin: 0;
    font-size: 14px;
    border: 2px solid black;
  }
`;

export default function DeleteCartItem({ id, children }) {
  return (
    <DeleteCartItemStyles>
      <button 
        type="button" 
        onclick={
          confirm('Are you su')
        }
      >
        {children}
      </button>
    </DeleteCartItemStyles>
  );
}
